import 'react-native-gesture-handler';
import React, { useState } from 'react';
import { 
  StyleSheet, 
  SafeAreaView, 
  View,
  Text,
  TouchableOpacity,
} from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { TextInput } from 'react-native-gesture-handler';
//import CustomerHome from './app/assets/CustomerHome';


const Stack = createStackNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator>
          <Stack.Screen 
              name="HOME" 
              component={CustomerHome}
          />

          <Stack.Screen 
              name="ADD TO WAITLIST"
              component={CustomerAdd}
          />
      </Stack.Navigator>
  </NavigationContainer>
  );
}


/**
 * Customer Home Screen
 * 
 */
function CustomerHome({ navigation }) {

  return (
      <SafeAreaView style={styles.container}>

          <View style={styles.tble}>

          </View>

          <TouchableOpacity
              style={styles.join_btn}
              onPress={() =>  navigation.navigate('ADD TO WAITLIST')}
          >
              <Text>JOIN</Text>
          </TouchableOpacity>

      </SafeAreaView>  
  );
}

/**
 * Customer Add Screen
 * 
 */
function CustomerAdd({ navigation }) {
  const [name_input, onChange] = useState('  Enter name here');


  return (
      <SafeAreaView style={styles.waitlist_container}>
          <View style={styles.info_container}>
            <TextInput
              style={styles.input_name}
              onChangeText={text => onChange(text)}
              value={name_input}
            >

            </TextInput>
          </View>


          <TouchableOpacity
              style={styles.add_btn}
              onPress={() =>  navigation.navigate('HOME')}
          >
              <Text>ADD</Text>
          </TouchableOpacity>
      </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    justifyContent: 'flex-end',
  },

  waitlist_container: {
    flex: 1,
    backgroundColor: '#fff',
    justifyContent: 'flex-end',
    alignItems: 'center'
  },

  info_container: {
    position: 'absolute',
    width: '80%',
    height: '50%',
    bottom: '30%',
    backgroundColor: '#fff',
    justifyContent: 'flex-start',
    alignItems: 'center'
  },

  join_btn: {
      width: '80%',
      height: 60,
      bottom: 20,
      backgroundColor: 'dodgerblue',
      justifyContent: 'center',
      alignItems: 'center',
      alignSelf: 'center'
  },

  add_btn: {
    width: '80%',
    height: 60,
    bottom: 20,
    backgroundColor: 'dodgerblue',
    justifyContent: 'center',
    alignItems: 'center',
    alignSelf: 'center'
  },

  tble: {
      position: 'absolute',
      bottom: '20%',
      alignSelf: 'center',
      width: '80%',
      height: '70%',
      backgroundColor: 'gray'
  },

  input_name: {
    height: 50,
    width: '80%',
    borderColor: 'black',
    borderWidth: 1
  }
});
